10.body:
우리는 이전 Future 트레잇 장에서 소켓을 비동기적으로 읽는 아래의 future 예제에 대해 살펴보았습니다.. pub struct SocketRead<'a> { socket: &'a Socket,
} impl SimpleFuture for SocketRead<'_> { type Output = Vec<u8>; fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { if self.socket.has_data_to_read() { // 소켓에 데이터가 준비됨-- 버퍼에 읽어 들이고 버퍼를 반환 Poll::Ready(self.socket.read_buf()) } else { // 소켓에 아직 데이터가 준비되지 않음 // // 데이터가 확보될 때, `wake`가 호출될 수 있도록 준비함. // 데이터가 확보되면, `wake`가 호출되고, 이 `Future`의 사용자는 // `poll`을 다시 호출하여 데이터를 읽을 수 있음을 알게 된다. // (TODO: 읽을 수 있음을 -> 읽음을?) self.socket.set_readable_callback(wake); Poll::Pending } }
} 이 future는 소켓에 준비된 데이터를 읽어들이지만, 준비된 데이터가 없다면 executor에게 "소켓에 데이터가 준비되면 future의 task를 다시 깨워주세요"라고 요청하면서 콘텍스트를 양보할 것입니다. 하지만, 이 예제에서는 Socket 타입이 어떻게 구현되는지 확실하지 않고, 특별히 set_readable_callback 함수가 작동하는지가 분명하지 않습니다. 어떻게 하면 소켓에 데이터가 준비되었을 때, wake()가 호출될 수 있게 할까요? 끊임없이 socket이 준비되었는지 확인하여 맞으면 wake()를 호출하는 스레드를 하나 만드는 것도 선택지가 될 것입니다. 그러나 이 방법은 블록된 입출력 future 각각마다 별개의 스레드가 필요하기 때문에 매우 비효율적이어서 우리의 비동기 코드의 효율을 크게 저하시킬 것입니다. 사실 이 문제는 입출력과 연계된 시스템 블로킹 기본기능과 통합으로 해결합니다. 예를 들면 리눅스의 epoll, FreeBSD와 Mac OS의 kqueue, 윈도우즈의 IOCP, 퓨시아의 port같은 것들이 있습니다(그리고 이것들 모두는 크로스 플랫폼 려스트 크레잇인 mio 를 이용하여 사용할 수 있습니다). 이러한 기본기능들은 모두 한 스레드가 여러개의 비동기 입출력 이벤트에 따라 블록하였다가 이벤트가 완성되면 반환할 수 있는 기능을 제공합니다. 이러한 API들은 실제로 보통 아래와 같은 형태입니다. struct IoBlocker { /* ... */
} struct Event { // 생성되어 전파되는 이벤트를 고유하게 식별하는 ID_ id: usize, // 기다리고 있거나, 발생된 시그널 집합 signals: Signals,
} impl IoBlocker { /// 블록할 비동기 입출력 이벤트의 새로운 컬렉션을 만든다. fn new() -> Self { /* ... */ } /// 특별한 입출력 이벤트에 interest를 삽입한다. fn add_io_event_interest( &self, /// 이벤트가 발생할 오브젝트 io_object: &IoObject, /// TODO: 검토 필요 /// `io_object`에서 나타날 시그널들의 집합이다. `io_object`에 대하여 /// 이벤트가 발동되어야 하는데, `io_object`는 ID와 짝지워져서 /// 이 interest에서 비롯된 이벤트들에게 주어진다. event: Event, ) { /* ... */ } /// 이벤트 중에 하나가 발생할 때까지 블록한다. fn block(&self) -> Event { /* ... */ }
} let mut io_blocker = IoBlocker::new();
io_blocker.add_io_event_interest( &socket_1, Event { id: 1, signals: READABLE },
);
io_blocker.add_io_event_interest( &socket_2, Event { id: 2, signals: READABLE | WRITABLE },
);
let event = io_blocker.block(); // 소켓에 데이터가 준비되면 "Socket 1 is now READABLE" 같은 걸 출력한다.
println!("Socket {:?} is now {:?}", event.id, event.signals); future의 executor들은 아래의 기본기능들을 비동기 입출력 객체를 제공하기 위해 사용할 수 있습니다. 예를 들어, 소켓은 특별한 입출력 이벤트가 발생하였을 때, 콜백이 실행되도록 설정할 수 있습니다. 위의 SocketRead 예제의 경우에 Socket::set_readable_callback 함수는 아래와 같은 의사코드와 비슷한 형태일 것입니다. impl Socket { fn set_readable_callback(&self, waker: Waker) { // `local_executor`는 지역 executor에 대한 레퍼런스이다. // `local_executor`는 소켓 생성시에 제공될 수도 있었겠지만, 실제로는 // 많은 executor 구현들이 편의상 스레드의 로컬 스토리지(TODO: 스레드 스택으로 // 의역?)를 통해서 아래로 전달한다. let local_executor = self.local_executor; // 이 입출력 객체의 고유 ID let id = self.id; // executor의 맵에 지역 waker를 저장한다. 이를 통해 지역 waker는 입출력 이벤트가 // 도착하면 호출될 수 있다. local_executor.event_map.insert(id, waker); local_executor.add_io_event_interest( &self.socket_file_descriptor, Event { id, signals: READABLE }, ); }
} 이로써 우리는 어떤 입출력 이벤트라도 받아서 딱맞는 Waker에게 보내줄 수 있는 executor 스레드를 만들었습니다. 그리고 Waker는 이벤트에 대응하는 task를 깨울 것입니다. 또, executor는 입출력 이벤트를 더 확인하기 전에 보다 많은 task들을 완성까지 운전할 수 있을 것입니다(그리고 사이클은 반복됩니다...).

11.body:
첫 장에서 우리는 async/.await을 짧게 다뤘습니다. 이제 async 코드가 어떻게 동작하고, 어떻게 전형적인 러스트 프로그램과 다른지 더 자세히 들여다봅시다. async/.await은 하나의 작업을 마칠 때 까지 기다리는 동안 다른 코드가 실행되는 것을 막거나 허용하는 대신 현재 스레드의 제어를 내놓는 러스트 문법의 특별한 도구입니다. async를 다루는 주 방법 두 가지, async fn과 async 블록이 있습니다. 각각 Future 트레잇을 구현한 값을 반환합니다. // `foo()`는 `Future<Output = u8>`을 구현한 타입을 반환합니다.
// `foo().await`은 `u8` 타입의 값을 나타낼 것입니다.
async fn foo() -> u8 { 5 } fn bar() -> impl Future<Output = u8> { // 이 `async` 블록은`Future<Output = u8>`을 구현한 // 타입을 반환합니다. async { let x: u8 = foo().await; x + 5 }
} 첫 장에서 봤듯이, async 안쪽과 그 밖의 future 구현체는 게으릅니다. 즉 실행될 때까지 아무 일도 안 합니다. Future를 실행하기 위해서는 .await을 써야 합니다. Future 상에서 .await이 나오면 그 코드는 마칠 때까지 실행하려 할 것입니다. Future는 자신이 중지되면 현재 스레드의 제어를 넘겨줍니다. 더 많은 흐름이 나올 시, Future는 .await을 풀고 실행자에게 선택돼 실행을 재개할 것입니다.

12.body:
참조나 기타 'static하지 않은 인자를 다루는 async fn은 전형적인 함수와 달리 인자의 수명으로 정해지는 Future를 반환합니다. // 이 함수는
async fn foo(x: &u8) -> u8 { *x } // 이 함수와 같습니다.
fn foo_expanded<'a>(x: &'a u8) -> impl Future<Output = u8> + 'a { async move { *x }
} 즉 'static하지 않은 인자가 여전히 유효하는 한 async fn에서 나온 future는 .await해야 합니다. 보통 foo(&x).await와 같이 함수를 호출하고 바로 future를 .await할 때는 문제가 없습니다. 허나 future를 또다른 작업이나 스레드로 저장하거나 보내면 문제가 생길 수 있습니다. 참조를 인자로 가진 async fn을 'static한 future로 바꾸는 방법 한 가지는 async fn 호출과 인자값을 하나의 async 블록으로 묶는 것입니다. fn bad() -> impl Future<Output = u8> { let x = 5; borrow_x(&x) // ERROR: `x`가 더 이상 쓸 수 없습니다.
} fn good() -> impl Future<Output = u8> { async { let x = 5; borrow_x(&x).await }
} 우리는 인자를 async 블록으로 옮김으로써 good 함수에서 나오는 Future의 것과 맞춰 인자의 수명을 늘릴 수 있습니다.

13.body:
async 블록과 클로저는 보통 클로저처럼 move 키워드를 허용합니다. async move 블록은 자신이 참조하는 변수의 소유권을 현재 구역보다 더 오래 살리면서 다른 코드가 공유할 수 없도록 합니다. /// `async` 블록:
///
/// 여러 `async` 블록은 같은 지역 변수에 접근할 수 있고
/// 변수의 구역 안에서 실행될 수 있습니다.
async fn blocks() { let my_string = "foo".to_string(); let future_one = async { // ... println!("{}", my_string); }; let future_two = async { // ... println!("{}", my_string); }; // 두 future를 완전히 실행해 "foo"를 두 번 출력합니다: let ((), ()) = futures::join!(future_one, future_two);
} /// `async move` 블록:
///
/// `async move` 블록으로부터 나온 `Future`가 캡처를 옮긴 이후로는 `async move` /// 블록 하나만 같은 캡처된 변수에 접근할 수 있습니다. 허나 이러면 `Future`를 원래 /// 그 변수의 구역에서보다 오래 살게 합니다.
fn move_block() -> impl Future<Output = ()> { let my_string = "foo".to_string(); async move { // ... println!("{}", my_string); }
}

