Pin은 Unpin 마커와 쌍으로 작동합니다. 고정하기는 !Unpin을 구현하는 객체가 절대 움직이지 않음을 보장하여 줍니다. 이게 왜 필요한지 이해하려면, async / .await가 작동하는 방식을 떠올려 보세요. 아래 코드를 살펴봅시다. let fut_one = /* ... */;
let fut_two = /* ... */;
async move { fut_one.await; fut_two.await;
} 보이지는 않지만, 위 코드는 Future를 구현하는 익명 타입을 만들어, 아래와 같은 poll 메소드를 제공합니다. // 위 `async { ... }` 블록이 생성한 `Future` 타입
struct AsyncFuture { fut_one: FutOne, fut_two: FutTwo, state: State,
} // 위 `async`블록이 될 수 있는 상태의 종류
enum State { AwaitingFutOne, AwaitingFutTwo, Done,
} impl Future for AsyncFuture { type Output = (); fn poll(mut self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<()> { loop { match self.state { State::AwaitingFutOne => match self.fut_one.poll(..) { Poll::Ready(()) => self.state = State::AwaitingFutTwo, Poll::Pending => return Poll::Pending, } State::AwaitingFutTwo => match self.fut_two.poll(..) { Poll::Ready(()) => self.state = State::Done, Poll::Pending => return Poll::Pending, } State::Done => return Poll::Ready(()), } } }
} poll이 처음 호출되면 poll은 fut_one을 poll할 것입니다. 만약 fut_one이 완성될 수 없다면, AsyncFuture::poll은 Poll::Pending을 반환하며 종료될 것입니다. future에 대한 poll 호출들은 이전에 중단된 지점(역주: self.state를 match하여)부터 다시 시작할 것입니다(TODO: 재번역 필요). 이 과정은 future가 성공적으로 완성될 때까지 반복될 것입니다. 하지만, async 블록이 참조를 사용한다면 어떻게 될까요? 예를 들어: async { let mut x = [0; 128]; let read_into_buf_fut = read_into_buf(&mut x); read_into_buf_fut.await; println!("{:?}", x);
} 위 코드는 어떤 구조체로 변환될까요? struct ReadIntoBuf<'a> { buf: &'a mut [u8], // 아래 `x`를 가리킴
} struct AsyncFuture { x: [u8; 128], read_into_buf_fut: ReadIntoBuf<'what_lifetime?>,
} 여기 ReadIntoBuf future는 우리 구조체의 다른 필드인 x를 가리키는 참조를 가지고 있습니다. 따라서, AsyncFuture가 옮겨진다면, x의 위치도 같이 움직이면서 read_into_buf_fut.buf에 저장된 포인터도 무효화 될 것입니다. future를 특정된 메모리 위치에 고정함으로서 이 문제를 방지하고, async 블록 안에 있는 값에 대한 참조를 안전하게 만들 수 있습니다.

17.body:
조금 더 간단한 예제로 고정하기를 이해해 봅시다. 위의 문제의 핵심은 '러스트에서 자기참조 타입의 참조를 어떻게 다루는가'입니다. 지금부터 우리의 예제는 다음과 같이 바뀔 겁니다. use std::pin::Pin; #[derive(Debug)]
struct Test { a: String, b: *const String,
} impl Test { fn new(txt: &str) -> Self { Test { a: String::from(txt), b: std::ptr::null(), } } fn init(&mut self) { let self_ref: *const String = &self.a; self.b = self_ref; } fn a(&self) -> &str { &self.a } fn b(&self) -> &String { unsafe {&*(self.b)} }
} Test는 a와 b 필드의 값에 대한 참조를 얻는 메소드를 제공합니다. b는 a에 대한 참조이기 때문에 b에 포인터를 사용합니다. 왜냐하면, 러스트의 빌림규칙에 따라 이 라이프타임을 정의할 수 없기 때문입니다. 이 구조체가 바로 자기-참조 구조체라고 불리는 것입니다. 아래 예제를 실행하면 알 수 있듯이, 어느 데이타도 여기저기 움직이지 않는다면 위 예제는 잘 작동할 겁니다. fn main() { let mut test1 = Test::new("test1"); test1.init(); let mut test2 = Test::new("test2"); test2.init(); println!("a: {}, b: {}", test1.a(), test1.b()); println!("a: {}, b: {}", test2.a(), test2.b()); }
# use std::pin::Pin;
# #[derive(Debug)]
# struct Test {
# a: String,
# b: *const String,
# }
#
# impl Test {
# fn new(txt: &str) -> Self {
# Test {
# a: String::from(txt),
# b: std::ptr::null(),
# }
# }
#
# // 자기-참조를 실제로 설정할 `init` 메소드
# fn init(&mut self) {
# let self_ref: *const String = &self.a;
# self.b = self_ref;
# }
#
# fn a(&self) -> &str {
# &self.a
# }
#
# fn b(&self) -> &String {
# unsafe {&*(self.b)}
# }
# } 예상한 대로 출력됩니다. a: test1, b: test1
a: test2, b: test2 그럼 test1과 test2를 스왑하여 데이터를 움직여보고, 무슨 일이 생기는 지 봅시다. fn main() { let mut test1 = Test::new("test1"); test1.init(); let mut test2 = Test::new("test2"); test2.init(); println!("a: {}, b: {}", test1.a(), test1.b()); std::mem::swap(&mut test1, &mut test2); println!("a: {}, b: {}", test2.a(), test2.b()); }
