a: test1, b: test1 하지만 실제 출력은 다음과 같습니다: a: test1, b: test1
a: test1, b: test2 스왑 이후에도, test2.b에 대한 포인터는 여전히 지금 test1 내부에 있는 옛 위치를 가리킵니다.(TODO: 의역으로 재번역) 이 구조체는 더 이상 자기-참조적이지 않으며, 다른 객체 안에 있는 필드를 가리키는 포인터를 가지게 됩니다. 즉, test2의 라이프타임에 매여있는 test2.b의 라이프타임을 더이상 신뢰할 수 없다는 뜻입니다. 만약 아직도 이해가 되지 않는다면, 아래 코드가 확실히 이해시켜 줄 것입니다. fn main() { let mut test1 = Test::new("test1"); test1.init(); let mut test2 = Test::new("test2"); test2.init(); println!("a: {}, b: {}", test1.a(), test1.b()); std::mem::swap(&mut test1, &mut test2); test1.a = "I've totally changed now!".to_string(); println!("a: {}, b: {}", test2.a(), test2.b()); }
