우리모두는 빠르고 안전한 소프트웨어를 작성할 수 있는 러스트를 좋아합니다. 하지만 왜 비동기 코드를 작성해야 할까요? 비동기 코드는 우리가 같은 운영체제 스레드 위에서 여러 task을 동시에 돌릴 수 있게 해줍니다. 당신이 전형적인 스레드 앱에서 동시에 웹 페이지 두 장을 다운로드하고 싶으면, 스레드 두 개를 통해 task을 넓힐 수 있습니다. 이렇게요. fn get_two_sites() { // task에 사용될 두 개의 스레드 생성 let thread_one = thread::spawn(|| download("https://www.foo.com")); let thread_two = thread::spawn(|| download("https://www.bar.com")); // 두 개의 스레드가 완료될 때까지 기다림 thread_one.join().expect("thread one panicked"); thread_two.join().expect("thread two panicked");
} 이 동작은 많은 앱에 잘 돌아갑니다. 결국 스레드는 한 번에 여러 task을 수행하기 위해 만들어졌습니다. 하지만 이런 행위에는 한계가 있습니다. 서로 다른 스레드를 바꾸거나 스레드끼리 데이터를 공유하는 과정에서 다소의 오버헤드가 발생하기 때문입니다. 존재하지만 아무 것도 하지 않는 스레드가 귀중한 시스템 자원을 고갈시킬 수도 있습니다. 이러한 문제를 없애기 위해 비동기 코드가 만들어졌습니다. 우리는 러스트의 async/ .await 표기를 함으로써 함수를 다시 작성할 수 있고, 그 코드는 다수의 스레드를 만들지 않고 한 번에 여러 task을 수행할 수 있게 만듭니다. async fn get_two_sites_async() { // 완성될때까지 실행된다면, 웹페이지를 비동기적으로 다운로드 할 두 개의 다른 // "future"를 만들기 let future_one = download_async("https://www.foo.com"); let future_two = download_async("https://www.bar.com"); // 두 개의 future를 완성될때까지 동시에 실행하기 join!(future_one, future_two);
} 대체로 비동기적인 앱은 똑같이 스레드로 구현된 방식보다 더 빠르고 더 자원을 덜 쓰는 잠재력이 있습니다. 그러나 한계도 있습니다. 스레드는 본디 운영체제에서 지원하고, 어떤 특별한 프로그래밍 모델도 필요하지 않습니다. 어떤 함수라도 스레드를 만들 수 있으며, 스레드를 사용하는 함수를 부르는 것은 그렇지 않은 평범한 함수를 부르는 것처럼 쉽습니다. 하지만 비동기 함수는 언어나 라이브러리로부터 특별한 지원을 받아야 합니다. 러스트에서는 async fn 표기가 Future를 반환하는 비동기 함수를 만들 수 있습니다. 함수를 실행하기 위해 반환된 Future는 완벽히 수행되어야 합니다. 전형적인 스레드 앱이 매우 효과적일 수도 있고 러스트가 차지하는 작은 메모리 공간과 예측 가능성이 async를 멀리 할 수 있다는 것을 의미한다는 것을 기억하시기 바랍니다. 비동기 프로그래밍 모델의 복잡성이 항상 옳은 것은 아니고 당신의 앱이 더 간단한 스레드 모델을 사용하는 게 더 좋은 것인지 생각해야 합니다.

