!Unpin타입을 힙에 고정하면 우리 데이타에 안정적인 주소를 부여하게 됩니다. 그래서 우리가 가리키는 데이터는 고정되고 나면 움직일 수 없습니다. 스택에 고정하기와 대조적으로, 데이터가 객체의 수명주기동안 고정됩니다. use std::pin::Pin;
use std::marker::PhantomPinned; #[derive(Debug)]
struct Test { a: String, b: *const String, _marker: PhantomPinned,
} impl Test { fn new(txt: &str) -> Pin<Box<Self>> { let t = Test { a: String::from(txt), b: std::ptr::null(), _marker: PhantomPinned, }; let mut boxed = Box::pin(t); let self_ptr: *const String = &boxed.as_ref().a; unsafe { boxed.as_mut().get_unchecked_mut().b = self_ptr }; boxed } fn a<'a>(self: Pin<&'a Self>) -> &'a str { &self.get_ref().a } fn b<'a>(self: Pin<&'a Self>) -> &'a String { unsafe { &*(self.b) } }
} pub fn main() { let mut test1 = Test::new("test1"); let mut test2 = Test::new("test2"); println!("a: {}, b: {}",test1.as_ref().a(), test1.as_ref().b()); println!("a: {}, b: {}",test2.as_ref().a(), test2.as_ref().b());
} 몇몇 함수들은 future가 Unpin 타입일 것을 요구합니다. Unpin이 아닌 Future나 Stream을 Unpin 타입을 요구하는 함수와 함께 사용하기 위해서는, 먼저 (Pin<Box<T>>을 만든다면) Box::pin이나 (Pin<&mut T>를 만든다면) pin_utils::pin_mut! 매크로를 사용하여 값을 고정해야 합니다. Pin<Box<Fut>>와 Pin<&mut Fut> 둘 다 future처럼 사용될 수 있으며, 둘 다 Unpin을 구현합니다. 예를 들어: use pin_utils::pin_mut; // `pin_utils`는 crates.io에 있는 가벼운 crate입니다. // `Unpin`을 구현하는 `Future`를 취하는 함수
fn execute_unpin_future(x: impl Future<Output = ()> + Unpin) { /* ... */ } let fut = async { /* ... */ };
execute_unpin_future(fut); // 오류: `fut`은 `Unpin` 트레잇을 구현하지 않음 // Pinning with `Box`:
let fut = async { /* ... */ };
let fut = Box::pin(fut);
execute_unpin_future(fut); // OK // Pinning with `pin_mut!`:
let fut = async { /* ... */ };
pin_mut!(fut);
execute_unpin_future(fut); // OK

