Result를 반환하는 future들에는 join!말고 try_join!을 사용하는 게 좋습니다. join!은 모든 하위 future들이 완성되었을 때에만 완성되므로, 하위 future 들 중 하나가 Err을 반환하였더라도 나머지 future들을 계속 처리할 것입니다. join!과 다르게, try_join!은 하위 future 중 하나가 에러를 반환하면 즉시 완성될 것입니다. use futures::try_join; async fn get_book() -> Result<Book, String> { /* ... */ Ok(Book) }
async fn get_music() -> Result<Music, String> { /* ... */ Ok(Music) } async fn get_book_and_music() -> Result<(Book, Music), String> { let book_fut = get_book(); let music_fut = get_music(); try_join!(book_fut, music_fut)
