Future 트레잇은 러스트 비동기 프로그래밍의 핵심입니다. Future는 비동기 연산의 일종으로, 한 개의 값을 산출할 수 있습니다(그 값이 ()같은 빈 값일지라도요). 단순화된 버전의 future 트레잇은 다음과 같은 형태라고 할 수 있습니다. trait SimpleFuture { type Output; fn poll(&mut self, wake: fn()) -> Poll<Self::Output>;
} enum Poll<T> { Ready(T), Pending,
} Future는 'poll' 함수를 호출하면 진행됩니다. poll 함수는 future가 완성될때까지 가능한만큼만 진행시킬 것입니다. 만약 Future가 완성된다면, Future는 Poll::Ready(result)를 반환합니다. Future가 아직 완성될 수 없다면, Future는 Poll::Pending을 반환한고, Future가 좀더 진행될 때를 대비하여 wake()함수를 준비합니다. wake() 함수가 호출되었을 때, Future를 운전(drive)하는 executor는 poll을 다시 호출하여 Future가 더 진행될 수 있게 합니다. wake() 없다면, executor는 어떤 future가 진행할 준비가 되었는지를 알 방법이 없어서, 아마 끊임없이 모든 future를 폴링(polling)해야만 할 것입니다. wake() 덕분에, executor는 어떤 future가 poll 될 수 있는지 정확히 알 수 있습니다. 예를 들어, 데이터를 제공할 준비가 되어 있는지 아닌지 알 수 없는 소켓에서 데이터를 읽어야 하는 사례를 생각해봅시다. 만약 데이터가 있다면, 우리는 데이터를 읽어들여서 Poll::Ready(data)를 반환하면 됩니다. 하지만, 데이터가 없다면, future는 블록될 것이고, 더 이상 진행할 수 없을 것입니다. 데이터가 준비되지 않았을 때에는, 데이터가 소켓에 준비되었을 때 wake가 호출될 수 있도록 wake를 등록해야 합니다. 이렇게 등록하면 executor에게 우리의 future가 진행될 준비가 되었음을 알릴 수 있습니다. 간단한 SocketRead future는 다음과 같은 형태라고 할 수 있습니다. pub struct SocketRead<'a> { socket: &'a Socket,
} impl SimpleFuture for SocketRead<'_> { type Output = Vec<u8>; fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { if self.socket.has_data_to_read() { // 소켓에 데이터가 준비됨-- 버퍼에 읽어 들이고 버퍼를 반환 Poll::Ready(self.socket.read_buf()) } else { // 소켓에 아직 데이터가 준비되지 않음 // // 데이터가 확보될 때, `wake`가 호출될 수 있도록 준비함. // 데이터가 확보되면, `wake`가 호출되고, 이 `Future`의 사용자는 // `poll`을 다시 호출하여 데이터를 읽을 수 있음을 알게 된다. // (TODO: 읽을 수 있음을 -> 읽음을?) self.socket.set_readable_callback(wake); Poll::Pending } }
} 아래 Future 모델은 여러개의 비동기 실행을 중간에 할당 없이 서로를 구성할 수 있게 해줍니다. 여러개의 future를 한 번에 실행하거나 각각을 연결하는 것은 다음과 같이 할당 없는 상태기계로 구현될 수 있습니다. /// 두 개의 다른 future를 실행하여 동시에 완성하는 SimpleFuture.
///
/// 각각의 future에 대한 `poll` 함수의 호출이 교차배치될 수 있어, 각 future가
/// 각자의 페이스대로 진행될 수 있게 해준다. 이를 통해 동시성을 얻을 수 있다.
pub struct Join<FutureA, FutureB> { // 각 필드는 완성될 때까지 실행되어야 하는 future를 한 개씩 갖을 수 있다. // 만약, future가 이미 완성되었다면, 그 필드는 `None`으로 설정된다. // 이를 통해, future가 완성된 이후에 폴링하는 `Future` trait 규칙 위반을 // 예방할 수 있다. a: Option<FutureA>, b: Option<FutureB>,
} impl<FutureA, FutureB> SimpleFuture for Join<FutureA, FutureB>
where FutureA: SimpleFuture<Output = ()>, FutureB: SimpleFuture<Output = ()>,
{ type Output = (); fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { // future `a`를 완성하려고 시도함. if let Some(a) = &mut self.a { if let Poll::Ready(()) = a.poll(wake) { self.a.take(); } } // future `b`를 완성하려고 시도함. if let Some(b) = &mut self.b { if let Poll::Ready(()) = b.poll(wake) { self.b.take(); } } if self.a.is_none() && self.b.is_none() { // 두 future 모두 완성되었음-- 성공적으로 반환함 Poll::Ready(()) } else { // 하나 또는 두 개의 future가 `Poll::Pending`을 반환하므로, 아직 // 해야 할 task이 남아 있습니다. future(들)은 진행이 가능 할 때 // `wake()`를 호출할 것입니다. Poll::Pending } }
} 위 예제는 여러개의 future가 각각에 대한 할당 없이도 어떻게 동시에 실행 될 수 있는지 보여줍니다. 이는 보다 효율적인 비동기 프로그램입니다. 마찬가지로, 여러개의 순차적 future는 아래와 같이 한 개 한 개 씩 실행될 수 있습니다. /// 두 개의 future가 완성될 때까지 순차적으로 실행하는 SimpleFuture
//
// 주의: 이 간단한 예제의 목적에 맞도록, `AndThenFut`은 첫 번째와 두 번째
// future 둘 다 생성시에 활성화되었다고 가정합니다. 진짜 `AndThen` 조합자는
// `get_breakfast.and_then(|food| eat(food))`와 같은 식으로 첫 번째 future의
// 결과에 따라 두 번째 future를 만들 수 있습니다.
pub struct AndThenFut<FutureA, FutureB> { first: Option<FutureA>, second: FutureB,
} impl<FutureA, FutureB> SimpleFuture for AndThenFut<FutureA, FutureB>
where FutureA: SimpleFuture<Output = ()>, FutureB: SimpleFuture<Output = ()>,
{ type Output = (); fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { if let Some(first) = &mut self.first { match first.poll(wake) { // 첫 번째 future가 완성되었습니다. 첫 번째를 제거하고 두 번째를 // 시작합니다! Poll::Ready(()) => self.first.take(), // 첫 번째 future도 완성되지 못했습니다. Poll::Pending => return Poll::Pending, }; } // 이제 첫 번재 future가 완성되었으니, 두 번째 future를 완성하려고 // 시도합니다. self.second.poll(wake) }
} 위의 예제들은 Future 트레잇이 여러개의 할당된 객체나 반복중첩된(deeply nested) 콜백 없이 비동기 흐름 제어를 구현하는 방법을 보여줍니다. 기본적인 흐름제어에 대한 설명은 이쯤에서 마치고, 진짜 Future 트레잇은 어떻게 생겼고, 무엇이 다른지 살펴봅시다. trait Future { type Output; fn poll( // `&mut self`에서 `Pin<&mut Self>`로 변화되었음: self: Pin<&mut Self>, // `wake: fn()`에서 `cx: &mut Context<'_>`로 변화되었음: cx: &mut Context<'_>, ) -> Poll<Self::Output>;
} 여러분이 확인하게 된 첫 번째 변화는 self 타입이 더 이상 &mut Self가 아니고, Pin<&mut Self>로 바뀌었다는 점입니다. a later section 에서 pinning에 대해 더 다루겠지만, 지금은 이동불가한 future를 만들 수 있게 해준다는 점을 알아 두십시오. 이동불가한 객체는 struct MyFut { a: i32, ptr_to_a: *const i32 } 처럼 필드 사이에 포인터를 저장할 수 있습니다. pinning은 async와 await를 활성화하기 위해 필요합니다. 두 번째로, wake: fn()은 &mut Context<'_>으로 바뀌었습니다. SimpleFuture에서, 우리는 future executor에게 완성되었는지 불확실한 future가 poll되어야 한다고 알려주기 위해 함수포인터 (fn())에 대한 호출을 사용하였습니다. 하지만, fn()은 단지 함수포인터일 뿐, 어떤 Future가 wake를 호출했는지에 대한 정보를 저장할 수 없습니다. 웹 서버 같은 현실적인 시나리오의 복잡한 어플리케이션에는 각각의 wakeup이 개별적으로 관리되어야 하는 수 천개의 커넥션이 있을 겁니다. 특정한 task를 wake하기 위해 사용되는 Waker 타입의 값에 대한 접근을 제공하는 Context 타입을 이용하여 이를 해결합니다.

8.body:
이 예제의 목적에 따라, 우리는 타이머가 만들어졌을 때 그냥 새 스레드를 하나 생성할 것이고, 필요한 만큼 sleep할 것입니다. 그리고 time window가 지나면, 타이머 future에 시그널을 보낼 것입니다. 시작하려면 다음처럼 import해야할 것들이 있습니다. use std::{ future::Future, pin::Pin, sync::{Arc, Mutex}, task::{Context, Poll, Waker}, thread, time::Duration,
}; 시작은 future 타입 자체를 정의하는 것입니다. 우리의 future는 타이머가 경과되었는지, 그래서 future가 완성되어야 하는지 여부를 스레드가 알 수 있는 방법이 필요합니다. 그래서 공유된 Arc<Mutex<..>> 값을 사용해서 스레드와 future 사이에 통신할 것입니다. pub struct TimerFuture { shared_state: Arc<Mutex<SharedState>>,
} /// future와 대기중인 스레드 사이에 공유된 상태
struct SharedState { /// 타이머가 경과되었는 지 여부 completed: bool, /// `TimerFuture`가 실행될 태스크 용 waker. /// 스레드는 `completed = true`라고 설정한 후에 `TimerFuture`의 task에게 /// '일어나서 `completed = true`인지 확인하고 진행하라'고 전하는 데 이 /// waker를 사용할 수 있다. waker: Option<Waker>,
} 자, 진짜로 Future 구현을 작성해 봅시다. impl Future for TimerFuture { type Output = (); fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { // 타이머가 이미 완성되었는지 알기 위해 공유된 상태를 확인. let mut shared_state = self.shared_state.lock().unwrap(); if shared_state.completed { Poll::Ready(()) } else { // waker를 설정해서 타이머가 완성되었을 때 스레드가 현재의 task를 // 깨울 수 있게 한다. 이렇게 함으로써 future가 다시 poll되어 // `completed = true`가 맞는지 확인 할 수 있다. // // waker를 매번 반복적으로 클론하지 않고 한 번만 클론하고 싶을 수도 // 있다. 하지만, `TimerFuture`는 executor의 여러 task들로 이동할 수 // 있기 때문에, 한 번만 클론하면 잘못된 task를 가리키는 정체된 // waker가 만들어져 `TimerFuture`가 제대로 못 깨워질 것이다. // // 주의: `Waker::will_wake` 함수를 이용하여 `TimerFuture`가 // 제대로 못 깨워지는 문제를 체크할 수 있으나, 예제를 간단하게 // 하기 위해 생략하였다. shared_state.waker = Some(cx.waker().clone()); Poll::Pending } }
} 꽤 간단하죠? 스레드가 shared_state.completed = true로 설정하였다면 다 된 것입니다. 아니라면, 우리는 스레드가 task를 다시 깨울 수 있도록, Waker를 현재의 task용으로 클론하여 shared_state.waker에 전달합니다. 중요한 점은, Waker를 future가 poll될 때마다 갱신해야 한다는 점입니다. 왜냐하면, 그 future가 다른 Waker와 같이 다른 task로 이동했을 수 있기 때문입니다. 이런 상황은 future가 poll되고 나서 task 사이에서 여기저기 전달될 때 발생합니다. 마지막으로, 실제로 타이머를 만들고 스레드를 시작할 API가 필요합니다. impl TimerFuture { /// 주어진 시간이 경과하면 완성되는 새로운 `TimerFuture`를 만든다. pub fn new(duration: Duration) -> Self { let shared_state = Arc::new(Mutex::new(SharedState { completed: false, waker: None, })); // 새로운 스레드 생성 let thread_shared_state = shared_state.clone(); thread::spawn(move || { thread::sleep(duration); let mut shared_state = thread_shared_state.lock().unwrap(); // 타이머가 완성되어서 future가 poll된 마지막 task를 (존재한다면) // 깨우는 시그널 shared_state.completed = true; if let Some(waker) = shared_state.waker.take() { waker.wake() } }); TimerFuture { shared_state } }
} 짠! 이게 간단한 타이머 future를 만드는데 필요한 전부입니다. 이제 future가 실행될 executor만 있으면 되는데요...

9.body:
러스트 Future는 지연계산됩니다. 실제로 완성시키기 위해 운전(TODO: 실행?)하기 전까지 future는 아무것도 하지 않을 것입니다. future를 완성시키기 위해 운전하는 한 가지 방법은 async 함수 안에서 future를 .await하는 것입니다. 다만, 그렇게 하면 문제가 하나 생깁니다: 누가 최상위 async 함수로부터 반환된 future를 실행할 것인가라는 문제입니다. 그리고 그 해답은 Future executor입니다. Future executor는 최상위 Future의 집합을 받아 Future가 진행할 수 있을 때마다 poll을 호출해서 완성될 때까지 실행합니다. 일반적으로, executor는 시작하면서 future를 한 번 poll합니다. Future가 wake()를 호출하여 진행할 준비가 되었음을 알릴 때, future는 큐 뒤에 넣어지고, poll이 다시 호출됩니다. 이는 Future가 완성될 때까지 반복됩니다. 이 장에서 우리는 수많은 최상위 future를 완성될 때까지 동시에 실행할 수 있는 간단한 executor를 만들 것입니다. 이 예제에서 Waker를 쉽게 만들 수 있게 도와주는 ArcWake 트레잇 때문에 futures 크레잇 의존성이 필요합니다. [package]
name = "xyz"
version = "0.1.0"
authors = ["XYZ Author"]
edition = "2018" [dependencies]
futures = "0.3" 다음은, src/main.rs의 맨 위에 아래와 같이 import합니다. use { futures::{ future::{BoxFuture, FutureExt}, task::{waker_ref, ArcWake}, }, std::{ future::Future, sync::mpsc::{sync_channel, Receiver, SyncSender}, sync::{Arc, Mutex}, task::{Context, Poll}, time::Duration, }, // 이전 장에서 작성한 타이머 timer_future::TimerFuture,
}; 실행할 task를 채널을 통해 보내면 우리의 executor가 작동할 겁니다. executor는 채널에서 이벤트를 당겨와서 실행합니다. 만약, 어떤 task가 조금 더 일 할 준비가 됐다면(즉, 깨워진다면), 그 task는 자기가 다시 poll될 수 있게 채널에 자기 스스로를 넣습니다. 이러한 설계 덕분에, executor는 그저 task 채널의 수신 단말만 있으면 됩니다. 유저에게는 송신 단말이 주어지므로, 새로은 future를 만들 수 있습니다. Task라는 것은 결국 스스로를 다시 스케쥴링할 수 있는 future일 뿐입니다. 따라서, 우리는 task들을 송신자(sender)와 짝지운 future의 형태로 저장할 것입니다. 송신자는 task가 자기자신을 큐에 넣는데 사용됩니다. /// 채널에서 task를 받아서 실행하는 task executor
struct Executor { ready_queue: Receiver<Arc<Task>>,
} /// 새 future를 task 채널에 생성해 넣는 `Spawner`
#[derive(Clone)]
struct Spawner { task_sender: SyncSender<Arc<Task>>,
} /// `Executor`에게 poll될 수 있게 스스로를 재스케줄링하는 future
struct Task { /// 완성되기 위해서 큐에 넣어져야 하는, 진행중인 future /// /// 정확히 하자면, `Mutex`가 꼭 필요한 것은 아니다. 우리는 한 시점에 /// (future들을 실행하는) 오직 하나의 스레드만 가지고 있기 때문이다. 하지만, /// 러스트는 우리의 `future`가 한 개의 스레드 안에서만 변경된다는 사실을 알 /// 수 없기 때문에, 우리는 스레드 안전성을 위해 `Mutex`를 사용해야만 한다. /// 현업에서는 `Mutex` 대신 `UnsafeCell`을 사용할 수도 있다. future: Mutex<Option<BoxFuture<'static, ()>>>, /// task가 자기자신을 task 큐의 마지막에 넣는데 사용되는 핸들 task_sender: SyncSender<Arc<Task>>,
} fn new_executor_and_spawner() -> (Executor, Spawner) { // 채널(큐)이 일시점에 가질 수 있는 task의 최대 갯수. // 그냥 `sync_channel`을 만드는데 필요한 것이고, 실제 executor에 적용될 일은 // 없을 것이다. const MAX_QUEUED_TASKS: usize = 10_000; let (task_sender, ready_queue) = sync_channel(MAX_QUEUED_TASKS); (Executor { ready_queue }, Spawner { task_sender })
} 새 future를 만들기 쉽게 메소드 한 개를 더 spawner에 추가합시다. 이 메소드는 future 타입을 받아서, box로 감싸고, 새 Arc<Task>로 만들 것입니다. 새로 만든 Arch<Task>는 excutor에게 enqueue될 것입니다. impl Spawner { fn spawn(&self, future: impl Future<Output = ()> + 'static + Send) { let future = future.boxed(); let task = Arc::new(Task { future: Mutex::new(Some(future)), task_sender: self.task_sender.clone(), }); self.task_sender.send(task).expect("too many tasks queued"); }
} future를 poll하기 위해서는, Waker를 생성해야 합니다. task 깨우기 section 에서 설명했듯이, Waker는 wake가 호출되면 task가 다시 poll될 수 있도록 스케쥴링합니다. Waker들은 executor에게 정확히 어떤 task가 준비되었는지 알려주기 때문에, executor는 진행할 준비가 된 future들만 poll한다는 점을 기억하십시오. 새로운 Waker를 만드는 가장 쉬운 방법은 ArcWake 트레잇을 구현하고, waker_ref나 .into_waker() 함수를 이용하여 Arc<impl ArcWake>를 Waker로 변경하는 것입니다. 우리의 task를 위한 ArcWake를 구현하여 Waker로 변경하고 깨워봅시다. impl ArcWake for Task { fn wake_by_ref(arc_self: &Arc<Self>) { // `wake`를 이 task를 다시 task 채널에 보내는 방식으로 구현한다. 그래서 // executor가 이 task를 다시 poll할 것이다. let cloned = arc_self.clone(); arc_self .task_sender .send(cloned) .expect("too many tasks queued"); }
} Arc<Task>로부터 만들어진 Waker의 wake()를 호출하면 Arc의 복사본이 task 채널로 송신될 것이다. 그러면 우리의 executor는 그 task를 집어 poll해야 한다. 구현해 봅시다. impl Executor { fn run(&self) { while let Ok(task) = self.ready_queue.recv() { // future를 취하고 나서, 아직 future가 완성되지 않았으면(아직 Some이면), // future를 완성하기 위해 poll한다. let mut future_slot = task.future.lock().unwrap(); if let Some(mut future) = future_slot.take() { // task 자기자신으로부터 `LocalWaker`를 생성한다. let waker = waker_ref(&task); let context = &mut Context::from_waker(&*waker); // `BoxFuture<T>`는 `Pin<Box<dyn Future<Output = T> + Send + // 'static>>`의 type alias이다. // `Pin::as_mut` 메소드를 호출하여 `BoxFuture<T>`로부터 // `Pin<&mut dyn Future + Send + 'static>`을 얻을 수 있다. if let Poll::Pending = future.as_mut().poll(context) { // future의 처리가 끝나지 않았으므로, 그것의 task에 도로 // 넣어서 미래에 다시 실행될 수 있게 한다. *future_slot = Some(future); } } } }
} 축하합니다! future executor를 완성하였습니다. 여러분이 만든 executor를 asycn/.await 코드나 우리가 아까 만든 TimeFuture같은 커스텀 future를 실행하는데도 사용할 수 있습니다. fn main() { let (executor, spawner) = new_executor_and_spawner(); // 타이머 전후로 문자열을 출력할 태스크를 생성한다. spawner.spawn(async { println!("howdy!"); // 우리의 타이머 future가 2초 후에 완성될 때까지 기다린다. TimerFuture::new(Duration::new(2, 0)).await; println!("done!"); }); // 여러분의 executor가 spawner가 끝났음을 확인하고 더 이상 실행할 task를 // 받지 않도록 spawner를 drop한다. drop(spawner); // excutor를 task 큐가 빌 때까지 실행한다. "howdy!" 출력, 일시중지, // "done!"출력 순으로 동작할 것이다. executor.run();
}
